import { NgModule } from "@angular/core";
import { CommonModule } from "@angular/common"; 
import { Component } from "@angular/core"; 

@Component({ 
  selector: "my-component, MyComponent", 
  template: ` 
    <header class="main-container"> 
      <div class="image-wrapper"> 
        <div class="description"> 
          <div class="title">Plant trees for free</div> 
          <div class="title">Make the planet better</div> 
        </div> 
      </div> 
      <div class="column-2"> 
        <span class="span-2"> 
          <div class="button">Sign in</div> 
          <div class="input-wrapper">
            <label for="email">Email</label>
            <input id="email" type="email" class="input" aria-label="Email" />
          </div> 
          <div class="input-wrapper">
            <label for="password">Password</label>
            <input id="password" type="password" class="input" aria-label="Password" />
          </div> 
          <div class="link">Login</div> 
          <div class="div-9">Otherwise, please</div> 
          <div class="link">Register here</div> 
        </span> 
      </div> 
    </header> 
  `, 
  styles: [ 
    ` 
    .main-container { 
      justify-content: center; 
      align-self: stretch; 
      background-color: var(--whitePure, #081c15); 
      display: flex; 
      flex-direction: column; 
      padding: 50px 16px; 
    } 

    .image-wrapper { 
      margin: 160px 0 92px; 
    } 

    @media (max-width: 991px) { 
      .image-wrapper { 
        max-width: 100%; 
        margin: 40px 0; 
      } 
    } 

    .description { 
      gap: 20px; 
      display: flex; 
    } 

    @media (max-width: 991px) { 
      .description { 
        flex-direction: column; 
        align-items: stretch; 
        gap: 0px; 
      } 
    } 

    .title { 
      color: var(--greenDark, #e8f5f1); 
      font: 500 24px Poppins, sans-serif; 
    } 

    @media (max-width: 991px) { 
      .title { 
        max-width: 100%; 
      } 
    } 

    .column-2 { 
      display: flex; 
      flex-direction: column; 
      line-height: normal; 
      width: 50%; 
      margin-left: 20px; 
    } 

    @media (max-width: 991px) { 
      .column-2 { 
        width: 100%; 
      } 
    } 

    .span-2 { 
      justify-content: center; 
      display: flex; 
      flex-grow: 1; 
      flex-direction: column; 
    } 

    @media (max-width: 991px) { 
      .span-2 { 
        max-width: 100%; 
        margin-top: 32px; 
      } 
    } 

    .button { 
      color: var(--greenDark, #e8f5f1); 
      font-feature-settings: "clig" off, "liga" off; 
      font: 400 32px Poppins, sans-serif; 
    } 

    @media (max-width: 991px) { 
      .button { 
        max-width: 100%; 
      } 
    } 

    .input-wrapper { 
      border-radius: var(--8, 8px); 
      background-color: var(--greenLight, #d0ffd7); 
      display: flex; 
      margin-top: 32px; 
      flex-direction: column; 
      justify-content: center; 
    } 

    @media (max-width: 991px) { 
      .input-wrapper { 
        max-width: 100%; 
      } 
    } 

    .input { 
      justify-content: center; 
      color: var(--constantGreenDark, #081c15); 
      border-radius: var(--4, 4px); 
      border: 1px solid var(--greenLight, #d0ffd7); 
      background-color: var(--greenLight, #d0ffd7); 
      padding: 0 2px; 
      font: 400 16px Inter, sans-serif; 
    } 

    @media (max-width: 991px) { 
      .input { 
        max-width: 100%; 
      } 
    } 

    .link { 
      color: var(--cardsWhite, #081c15); 
      white-space: nowrap; 
      justify-content: center; 
      align-items: center; 
      border-radius: 6px; 
      box-shadow: 0px 4px 61px 0px rgba(45, 106, 79, 0.4); 
      background-color: var(--cardsMainColor, #f4fbf9); 
      margin-top: 32px; 
      padding: 11px 60px; 
      font: 600 18px Poppins, sans-serif; 
    } 

    @media (max-width: 991px) { 
      .link { 
        white-space: initial; 
        max-width: 100%; 
        padding: 0 20px; 
      } 
    } 

    .div-9 { 
      color: var(--greenDark, #e8f5f1); 
      flex-grow: 1; 
      white-space: nowrap; 
      margin: auto 0; 
      font: 400 14px Poppins, sans-serif; 
    } 

    @media (max-width: 991px) { 
      .div-9 { 
        white-space: initial; 
      } 
    } 

    .div-10 { 
      color: var(--greenDark, #e8f5f1); 
      align-self: stretch; 
      flex-grow: 1; 
      white-space: nowrap; 
      font: 600 16px Poppins, sans-serif; 
    } 

    @media (max-width: 991px) { 
      .div-10 { 
        white-space: initial; 
      } 
    }
  `, 
  ],
})
export class MyComponent {}
